import React from 'react'
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';

import img from '../images/OceanMaine.jpg'

const Main = () => {
  return (
    <div>
    <Carousel>
        <div>
            <img src={img}/>
            <p className="legend">Maine</p>
        </div>
    </Carousel>
    </div>
  )
}

export default Main
